example : (s ∪ ⋂ i, A i) = ⋂ i, A i ∪ s  := by
  ext x
  simp only [mem_union, mem_iInter]
  constructor
  rintro (xs | xI) i; { right; exact xs } <|> { left; exact xI i }
  intro h; by_cases xs : x ∈ s
  { left; exact xs }
  { right; intro i; exact (h i).resolve_right xs }

