theorem primes_mod_4_eq_3_infinite : ∀ n, ∃ p > n, Nat.Prime p ∧ p % 4 = 3  := by
  intro n
  set m := 4 * ∏ i in filter (λ p, Nat.Prime p ∧ p % 4 = 3) (Finset.range (n + 1)), i + 3
  have h : m % 4 = 3 := by rw [add_comm, Nat.add_mul_mod_self_left]
  rcases exists_prime_factor_mod_4_eq_3 h with ⟨p, pp, pdvd, p4eq⟩
  use p; constructor;
  apply lt_of_le_of_lt _ (Nat.lt_succ_self _);
  apply Finset.le_sup (Finset.mem_filter.mpr ⟨Nat.Prime p, p4eq⟩);
  exact pp

